import java.util.LinkedHashSet;

public class Main {
    public static void main(String[] args) {
        LinkedHashSet<Integer> set = new LinkedHashSet<>();
        int t = 7676; // Some unrelated computation
        int flag = t % 3; // Flag based on arbitrary condition

        /* unrelated add operations */
        set.add(10);
        set.add(20);
        if (flag < 2) {
            set.add(30);
        }
        set.add(40);

        /* write */
        if (t % 2 == 0) { // Condition affecting write
            set.add(50);
        } else {
            set.add(60);
        }

        // More unrelated operations
        set.add(70);
        set.add(80);
        set.remove(10); // Misleading removals
        set.add(90);

        // Retrieve the value from the set
        /* read */ int ret = 0;
        int count = 0;
        for (int num : set) {
            if (count == 2) { // The position of interest
                ret = num;
                break;
            }
            count++;
        }

        // Output the retrieved value
        System.out.println("Retrieved value: " + ret);
    }
}
